import React from 'react'
import {HomeOutlined, GridOffOutlined, ShareOutlined, BarChart, AccountBoxOutlined, 
    DynamicFeedOutlined, FileCopyOutlined} from '@material-ui/icons'
import {Grid, Link} from '@material-ui/core'


const dataMenu = [{
        title : 'Home',
        icon : <HomeOutlined className="icon-menu" style={{color:"#a1a1a1", textAlign:'center'}}/>
    },{
        title : 'Browse',
        icon : <GridOffOutlined className="icon-menu" style={{color:"#a1a1a1"}}/>
    },{
        title : 'Category',
        icon : <ShareOutlined className="icon-menu" style={{color:"#a1a1a1"}} />
    },{
        title : 'Trending',
        icon : <BarChart className="icon-menu" style={{color:"#a1a1a1"}}/>
    },{
        title : 'Profile',
        icon : <AccountBoxOutlined className="icon-menu" style={{color:"#a1a1a1"}}/>
    },{
        title : 'Recently Played',
        icon : <DynamicFeedOutlined className="icon-menu" style={{color:"#a1a1a1"}}/>
    },{
        title : 'Recently Played',
        icon : <FileCopyOutlined className="icon-menu" style={{color:"#a1a1a1"}}/>
    }
]
const Menu = () => {
  return (
    <center>
        <div className="container-menu">
            <div className="logo">
                MOVIE
            </div>
            <Grid container justify="center" style={{display:'inline-block'}}>
                {
                    dataMenu.map((value) => (
                        <Grid key={value.title} item xs={12} sm={12} lg={12} xl={12}>
                            <Link href="#" color="inherit">
                                <div className="item-menu">
                                    {value.icon}
                                    <p className="title-menu">{value.title}</p>
                                </div>
                            </Link>
                        </Grid>
                    ))
                }
            </Grid>
            <style jsx>{`
                @import url('https://fonts.googleapis.com/css?family=Poppins&display=swap');
                .container-menu {
                    display:inline-block;
                    flex-direction:column;
                    text-align: center;
                    background:#ffffff;
                }
                .logo {
                    margin-bottom:40px;
                    font-weight:bold;
                    font-size:20px;
                    font-family: Poppins;
                    display: inline-block;
                }
                .menu {
                    justify-content:center;
                    text-align: center;
                    display: inline-block;
                }
                .item-menu {
                    display:flex;
                    flex-direction:row;
                    align-items:center;
                }
                .title-menu {
                    color: #a1a1a1;
                    font-size:14px;
                    font-family: Poppins;
                }
                .icon-menu {
                    font-size:14px;
                    margin-right:5px;
                    color:#a1a1a1;
                }
            `}</style>
        </div>
    </center>
  )
}

Menu.propTypes = {

}

export default Menu
